import React from 'react';
import { Link } from 'react-router-dom';

const Course = () => {
  return (
    <div>
      <h2>Course</h2>
      {/* Link to CourseDetails with a dynamic parameter (replace '123' with the actual course ID) */}
      <Link to="/course-details/123">View Course Details</Link>
    </div>
  );
};

export default Course;
